css:
.ColorPicker-hueSelectorWrapper {
  position: absolute;
  bottom: 10px;
  right: 10px;
  pointer-events: none;
}
.ColorPicker-hueSelectorWrapper:after {
  content: '';
  border: 2px solid #ebebeb;
  border-radius: 3px;
  box-shadow: inset 0 0 1px rgba(0, 0, 0, 0.5);
  position: absolute;
  top: -2px;
  right: -2px;
  bottom: -2px;
  left: -2px;
  z-index: 10;
}
.ColorPicker-hueSelection {
  width: 18px;
  height: 7px;
  margin-top: -4px;
  border: 2px solid #fff;
  border-radius: 1px;
  box-shadow: 0 0 1px rgba(0, 0, 0, 0.3), inset 0 0 1px rgba(0, 0, 0, 0.6);
  position: absolute;
  top: 1px;
  right: 1px;
  left: 1px;
  z-index: 20;
  pointer-events: none;
}
.ColorPicker-hueSelector {
  width: 20px;
  height: 180px;
  display: block;
  cursor: -webkit-grab;
  pointer-events: all;
}
.ColorPicker-hueSelector:active {
  cursor: -webkit-grabbing;
}
